 Lite, all your settings will be deleted from your WordPress database.'=>'Se esta caixa estiver marcada e você desinstalar o PDF Ink Lite, todas as suas configurações serão excluídas do banco de dados do WordPress.','Marked PDF files will accumulate in your PDF folder whether using Force downloads or not. To keep your server tidy, manually delete ad lib or <strong><a href="%s" target="_blank" rel="noopener">upgrade this plugin</a></strong> for better file handling and automatic cleaning.'=>'Os arquivos PDF marcados serão acumulados na sua pasta PDF, independentemente de você usar o recurso “Forçar downloads” ou não. Para manter seu servidor organizado, exclua manualmente os arquivos indesejados ou <strong><a href="%s" target="_blank" rel="noopener">atualize este plugin</a></strong> para obter um melhor gerenciamento de arquivos e limpeza automática.','Give Us Attribution'=>'Dê-nos os créditos','We\'d love it if you check this box and allow us to add a tiny, invisible link to the second page of your marked PDF files, giving PDF Ink Lite credit.'=>'Gostaríamos muito que você marcasse esta caixa e nos permitisse adicionar um pequeno link invisível à segunda página dos seus arquivos PDF marcados, dando crédito ao PDF Ink Lite.','Logging'=>'Histórico','Enable Logs?'=>'Ativar registros?','Check to enable event/error logging. This can help with debugging.'=>'Marque para ativar o registro de eventos/erros. Isso pode ajudar na depuração.','More Info'=>'Mais Informações','PDF Ink Lite is rudimentary and may not work on every PDF. Test before going live, and remember, it\'s free!'=>'O PDF Ink Lite é rudimentar e pode não funcionar em todos os PDFs. Teste antes de entrar em operação e lembre-se: é gratuito!','The only watermarking plugin for Download Monitor that works with any and every PDF is the <a href="%s" target="_blank" rel="noopener">PDF Ink upgrade combined with the SetaPDF-Stamper add-on</a>.'=>'O único plugin de marca d\'água para o Download Monitor que funciona com 