al Downloads that works with any and every PDF is the <a href="%s" target="_blank" rel="noopener">PDF Ink upgrade combined with the SetaPDF-Stamper add-on</a>.'=>'O único plugin de marca d\'água para Easy Digital Downloads que funciona com qualquer PDF é a <a href="%s" target="_blank" rel="noopener">atualização PDF Ink combinada com o complemento SetaPDF-Stamper</a>.','PDF Ink Lite Settings'=>'Configurações do PDF Ink Lite','Enable Watermarking'=>'Ativar marca d\'água','Check to watermark PDFs sold via Easy Digital Downloads using the settings below.'=>'Verifique se os PDFs vendidos através do Easy Digital Downloads têm marca d\'água usando as configurações abaixo.','List file name(s) of PDF(s), one per line, e.g.,'=>'Liste o(s) nome(s) do(s) arquivo(s) PDF, um por linha, por exemplo:','or'=>'ou','Case-sensitive.'=>'Sensível a maiúsculas e minúsculas.','If left blank and the Global checkbox above is checked, ALL PDFs sold through EDD will be watermarked.'=>'Se deixado em branco e a caixa de seleção Global acima estiver marcada, TODOS os PDFs vendidos através do EDD terão uma marca d\'água.','Right to Left Watermarking'=>'Marca d\'água da direita para a esquerda','Check to switch from default left-to-right (LTR) to right-to-left (RTL), for Arabic, Hebrew, etc.'=>'Marque para alternar da configuração padrão da esquerda para a direita (LTR) para da direita para a esquerda (RTL), para árabe, hebraico, etc.','Pages to watermark'=>'Páginas para marca d\'água','Watermark every page, the first page only, the last page only, every odd page, every even page, or custom page range. Defaults to `Every page`'=>'Coloque marca d\'água em todas as páginas, apenas na primeira página, apenas na última página, em todas as páginas ímpares, em todas as páginas pares ou em um intervalo de páginas personalizado. O padrão é "Todas as páginas"','Top/bottom margin'=>'Margem superior/inferior','Left/right margin'=>'Margem esquerda/direita','Page Setup'=>'Configurações da página','Rotate the watermark on the page 0-359 degrees. Rotation is counter-clockwise.'=>'Gire a marca d\'água na página de 0 a 359 graus. A rotação é no sentido anti-horário.','X Fine Tuning'=>'X Ajuste fino','Move the watermark left and right by adjusting this number. In millimeters. Default 0'=>'Mova a marca d\'água para a esquerda e para a direita ajustando este número. Em milímetros. Padrão 0','Move the content up and down on the page by adjusting this number. In millimeters.Account for the height of your font/text!'=>'Mova o conteúdo para cima e para baixo na página ajustando este número. Em milímetros. Leve em consideração a altura da sua fonte/texto!','Security Settings'=>'Configurações de segurança','Serve PDF if not watermarked?'=>'Servir PDF se não tiver marca d\'água?','If no, the customer will receive an error message saying if file preparation has failed.'=>'Caso contrário, o cliente receberá uma mensagem de erro informando que a preparação do arquivo falhou.','Encryption level'=>'Nível de criptografia','Check this box to make it more difficult for your PDF to be printed by the end consumer.'=>'Marque esta caixa para tornar mais difícil a impressão do seu PDF pelo consumidor final.','Check this box to prevent editing/modification of your PDF by the end consumer in Acrobat.'=>'Marque esta caixa para impedir a edição/modificação do seu PDF pelo consumidor final no Acrobat.','Check this box to prevent the addition or modification of text annotations/comments, and filling of interactive form fields. If "editing and annotation" are both allowed, customers can create or modify interactive form fields (including signature fields).'=>'Marque esta caixa para impedir a adição ou modificação de anotações/comentários de texto e o preenchimento de campos de formulários interativos. Se a “edição e anotação” forem permitidas, os clientes poderão criar ou modificar campos de formulários interativos (incluindo campos de assinatura).','Check this box to prevent insertion, rotation, or deletion of pages and creation of bookmarks or thumbnail images.'=>'Marque esta caixa para impedir a inserção, rotação ou exclusão de páginas e a criação de marcadores ou imagens em miniatura.','Check this box to prevent filling in existing interactive form fields (including signature fields).'=>'Marque esta caixa para impedir o preenchimento de campos de formulários interativos existentes (incluindo campos de assinatura).','Disable Accessibility'=>'Desativar acessibilidade','Check this box to prevent extraction of text and graphics (in support of accessibility to users with disabilities or for other purposes). Some PDF readers already disable this.'=>'Marque esta caixa para impedir a extração de texto e gráficos (para facilitar a acessibilidade a usuários com deficiências ou para outros fins). Alguns leitores de PDF já desativam essa opção.','User Password (optional)'=>'Senha do usuário (opcional)','Owner Password (optional)'=>'Senha do proprietário (opcional)','Easy Digital Downloads debug logs can be found at Downloads > Tools > Debug Log'=>'Os registros de depuração do Easy Digital Downloads podem ser encontrados em Downloads > Ferramentas > Registro de depuração','Leave No Trace'=>'Não deixe rastros','If this box is checked and you uninstall PDF Ink Lite, all your settings will be deleted from your Wordpress database.'=>'Se esta caixa estiver marcada e você desinstalar o PDF Ink Lite, todas as suas configurações serão excluídas do banco de dados do Wordpress.','New with PDF Ink Lite v4: marked PDF files are stored in the wp-content/uploads/pdf-ink/ folder for easier management.'=>'Novidade no PDF Ink Lite v4: os arquivos PDF marcados são armazenados na pasta wp-content/uploads/pdf-ink/ para facilitar o gerenciamento.','Marked PDF files will accumulate in your PDF folder whether using Force downloads or not. To keep your server tidy, manually delete ad lib or <a href="%s" target="_blank" rel="noopener">upgrade this plugin</a> for better file handling and automatic cleaning.'=>'Os arquivos PDF marcados serão acumulados na sua pasta PDF, independentemente de você usar o recurso “Forçar downloads” ou não. Para manter seu servidor organizado, exclua manualmente os arquivos indesejados ou <a href="%s" target="_blank" rel="noopener">atualize este plugin</a> para obter um melhor gerenciamento de arquivos e limpeza automática.','PDF Ink Lite Logs'=>'Registros PDF Ink Lite','Check to watermark PDFs sold via WooCommerce using the settings below.'=>'Verifique se os PDFs vendidos através do WooCommerce têm marca d\'água usando as configurações abaixo.','File(s) to watermark'=>'Arquivo(s) para aplicar marca d\'água',' Case-sensitive.'=>' Sensível a maiúsculas e minúsculas.','Enable New Logic?'=>'Ativar nova lógica?','If this box is checked, it changes how the `File(s) to Watermark` field above works.'=>'Se esta caixa estiver marcada, altera o funcionamento do campo “Arquivo(s) para marca d\'água” acima.','If checked, and "Enable Watermarking" is also checked, any files listed in the box will not be watermarked.'=>'Se estiver marcado e a opção “Ativar marca d\'água” também estiver marcada, nenhum dos arquivos listados na caixa receberá marca d\'água.','If checked, and "Enable Watermarking" is not checked, any files listed in the box will be watermarked.'=>'Se estiver marcado e a opção “Ativar marca d\'água” não estiver marcada, todos os arquivos listados na caixa receberão uma marca d\'água.','Licensed to [FIRSTNAME] [LASTNAME], [EMAIL]'=>'Licenciado para [PRÓPRIO NOME] [SOBRENOME], [EMAIL]','The only watermarking plugin for WooCommerce that works with any and every PDF is the <a href="%s" target="_blank" rel="noopener">PDF Ink upgrade combined with the SetaPDF-Stamper add-on</a>.'=>'O único plugin de marca d\'água para WooCommerce que funciona com qualquer PDF é a <a href="%s" target="_blank" rel="noopener">atualização PDF Ink combinada com o complemento SetaPDF-Stamper</a>.','Greyed-out settings below are included in the full (paid) plugin