cíficos do cliente, como nome, sobrenome e e-mail. Sua marca d\'água é altamente personalizável e manipulável.','<a href="%s" target="_blank" rel="noopener">Consider upgrading to PDF Ink</a> if you need more functionality.'=>'<a href="%s" target="_blank" rel="noopener">Considere atualizar para o PDF Ink</a> se precisar de mais funcionalidades.','For more information:'=>'Para mais informações:','Frequently Asked Questions'=>'Perguntas Frequentes','Plugin at WordPress.org'=>'Plugin no WordPress.org','Upgrade'=>'Atualizar','Cloning is forbidden.'=>'A clonagem é proibida.','Unserializing instances of this class is forbidden.'=>'As instâncias de desserialização dessa Classe são proibidas.','PDF Ink Lite supports PHP %s or later. Please update PHP on your server for better overall results.'=>'O PDF Ink Lite é compatível com PHP %s ou posterior. Atualize o PHP no seu servidor para obter melhores resultados gerais.','PDF Ink Lite supports WordPress version %s or later. Please update WordPress to use this plugin.'=>'O PDF Ink Lite é compatível com a versão %s ou posterior do WordPress. Atualize o WordPress para usar este plugin.','The PDF Ink Lite plugin requires WooCommerce be activated. You can <a href="%s" target="_blank" rel="noopener">download WooCommerce here</a>.'=>'O plugin PDF Ink Lite requer que o WooCommerce esteja ativado. Você pode <a href="%s" target="_blank" rel="noopener">baixar o WooCommerce aqui</a>.','Sorry, PDF Ink Lite supports WooCommerce version %s or newer, for security reasons.'=>'Desculpe, o PDF Ink suporta a versão WooCommerce %s ou mais recente, por motivos de segurança.','PDF Ink Lite requires that the directory defined by <code>PDFINK_LITE_UPLOADS_PATH</code> (usually `<strong>wp-content/uploads/pdf-ink/</strong>`) is writable.'=>'O PDF Ink Lite requer que o diretório definido por <code>PDFINK_LITE_UPLOADS_PATH</code> (normalmente `<strong>wp-content/uploads/pdf-ink/</strong>`) seja gravável.','Watermarking events and errors will be saved to a file in your /wp-content/ folder. You can view the contents below.'=>'Os eventos e erros de marca d\'água serão salvos em um arquivo na sua pasta /wp-content/. Você pode visualizar o conteúdo abaixo.','Maybe only turn this on for troubleshooting because this file can get large.'=>'Talvez seja melhor ativar essa opção apenas para solucionar problemas, pois esse arquivo pode ficar muito grande.','Use this tool to help debug TCPDI/TCPDF and PDF Ink functionality.'=>'Use esta ferramenta para ajudar a depurar as funcionalidades TCPDI/TCPDF e PDF Ink.','Download Debug Log File'=>'Baixar arquivo de registro de depuração','Clear Log'=>'Limpar log','Copy Entire Log'=>'Copiar log inteiro','Log file'=>'Arquivo de log','Hi, I\'m Caroline.'=>'Olá, sou a Caroline.','I\'ve kept the PDF Ink Lite plugin in active development since 2014 as an unpaid volunteer.'=>'Mantenho o plugin PDF Ink Lite em desenvolvimento ativo desde 2014 como voluntário não remunerado.','If you enjoy the free version, think about <a href="%s" target="_blank" rel="noopener">upgrading to the full version</a> for even more great features!'=>'Se você gosta da versão gratuita, considere <a href="%s" target="_blank" rel="noopener">atualizar para a versão completa</a> para ter acesso a ainda mais recursos incríveis!','Upgrade Features:'=>'Recursos da atualização:','Priority email support, <a href="%s" target="_blank" rel="noopener">and more!</a>'=>'Suporte prioritário por e-mail <a href="%s" target="_blank" rel="noopener">e muito mais!</a>','Can\'t Upgrade? Support My Work Another Way!'=>'Não consegue atualizar? Apoie meu trabalho de outra forma!','If PDF Ink is not in your budget, please take a moment to write <a href="%s" target="_blank" rel="noopener">an encouraging review</a>, or <a href="%s" target="_blank" rel="noopener noreferrer">donate a couple dollars using PayPal</a> to cover my coffee today.'=>'Se o PDF Ink não estiver dentro do seu orçamento, reserve um momento para escrever <a href="%s" target="_blank" rel="noopener">uma avaliação encorajadora</a> ou <a href="%s" target="_blank" rel="noopener noreferrer">doe alguns dólares usando o PayPal</a> para cobrir meu café hoje.','Your kindness and enthusiasm makes donating my time to this open-source project worthwhile!'=>'Sua gentileza e entusiasmo fazem com que valha a pena dedicar meu tempo a este projeto de código aberto!','Need help?'=>'Precisa de ajuda?','Please refer to the <a href="%s" target="_blank" rel="noopener">FAQ</a> and <a href="%s" target="_blank" rel="noopener nofollow">support forum</a> where your question might already be answered. <a href="%s" rel="noopener">Read this before posting</a>.'=>'Consulte as <a href="%s" target="_blank" rel="noopener">perguntas frequentes</a> e <a href="%s" target="_blank" rel="noopener nofollow">o fórum de suporte</a>, onde sua dúvida pode já ter sido respondida. <a href="%s" rel="noopener">Leia isto antes de postar</a>.','I only provide email support for paying customers. Thank you!'=>'Eu só ofereço suporte por e-mail para clientes pagantes. Obrigado!','https://wordpress.org/plugins/waterwoo-pdf/'=>'https://wordpress.org/plugins/waterwoo-pdf/','Custom watermark your PDF files upon WooCommerce, Download Monitor, and Easy Digital Download customer download. Since 2014. FKA "WaterWoo"'=>'Coloque marcas d\'água personalizadas em seus arquivos PDF no WooCommerce, Download Monitor e Easy Digital Download para download pelo cliente. Desde 2014. Anteriormente conhecido como "WaterWoo".']];
